import Input from '../../UI/Input';
import classes from './MealsItemFrom.module.css';

const MealsItemFrom=()=>{
    return(
        <form className={classes.form}>
            <Input lable='Amount'
            input={{
                id:'amount',
                type:'number',
                min:'1',
                max:'5',
                defaultValue:'1',
                step:'1'
            }}/>
            <button>+ Add</button>
        </form>
    );
    
};

export default MealsItemFrom;
